import React from 'react';
import styled from 'styled-components';

const Main = () => {
    return (
        <MainStyled>
            <h1>Page Title</h1>
        </MainStyled>
    );
}

export default Main;

const MainStyled = styled.main`
    h1 {
        font-size: 75px;
    }
`;
